import styled from "styled-components";
import arrow from "../images/next.png";

const Container = styled.div`
    width: 100%;
    height: 100vh;
    display: flex;
`

const Slider = () => {
    return(
        <Container>
            <Arrow>
            <img src={arrow} alt='arrow'/>
            </Arrow>
        </Container>
    )
}

export default Slider
